Alpha Girl #1-3 [IMAGE Comics]


Its 1984, and Judith is your typical 17 year old. She chain smokes, cuts class, sells her tampons to perverts, and she just might be the last sane woman left on the planet. When a third rate cosmetics company creates a pheromone that turns women into crazed man eaters, the world dives into chaos. Judith must break her little brother out of juvie, all the while dodging rabid women and the men who hunt them. Already a proven survivor, she picks up some interesting strays along the way and kicks some serious zombie ass! Judith is Alpha Girl!

